import allergy2 from './imgs/allergy2.png'

export default function ProjectImgs() {
    return(
        <div>
            <img className="projectimg" src={allergy1} alt="allergy1"></img><br></br>
            <img className="projectimg" src={allergy2} alt="allergy2"></img>
        </div>
    )
}
